// src/components/Navbar.jsx
import React, { useState, useEffect } from 'react';
import { Link, useNavigate, useLocation } from 'react-router-dom';
import { useAuth } from '../contexts/AuthContext';
import '../styles/navbar.css';

const Navbar = () => {
    const { isAuthenticated, user, logout } = useAuth();
    const navigate = useNavigate();
    const location = useLocation();
    const [isScrolled, setIsScrolled] = useState(false);
    const [isMobileMenuOpen, setIsMobileMenuOpen] = useState(false);
    const [isDropdownOpen, setIsDropdownOpen] = useState(false);

    useEffect(() => {
        const handleScroll = () => {
            setIsScrolled(window.scrollY > 50);
        };
        window.addEventListener('scroll', handleScroll);
        return () => window.removeEventListener('scroll', handleScroll);
    }, []);

    const handleLogout = () => {
        logout();
        navigate('/');
        setIsMobileMenuOpen(false);
    };

    const toggleMobileMenu = () => {
        setIsMobileMenuOpen(!isMobileMenuOpen);
    };

    const closeMobileMenu = () => {
        setIsMobileMenuOpen(false);
    };

    const isActive = (path) => {
        return location.pathname === path;
    };    return (
        <nav className={`navbar ${isScrolled ? 'scrolled' : ''}`}>
            <div className="container">
                <div className="nav-wrapper">
                    {/* Brand */}
                    <Link to="/" className="navbar-brand">
                        <div className="brand-logo">
                            <span>ðŸŽ“</span>
                        </div>
                        <span className="brand-text">IYIP Platform</span>
                    </Link>

                    {/* Desktop Navigation */}
                    <div className="nav-menu desktop-menu">
                        <Link to="/" className={`nav-link ${isActive('/') ? 'active' : ''}`}>
                            Home
                        </Link>
                        {isAuthenticated && (
                            <>
                                <Link to="/dashboard" className={`nav-link ${isActive('/dashboard') ? 'active' : ''}`}>
                                    Dashboard
                                </Link>
                                <Link to="/events" className={`nav-link ${isActive('/events') ? 'active' : ''}`}>
                                    Events
                                </Link>
                                <Link to="/journals" className={`nav-link ${isActive('/journals') ? 'active' : ''}`}>
                                    Journals
                                </Link>
                                <Link to="/communities" className={`nav-link ${isActive('/communities') ? 'active' : ''}`}>
                                    Communities
                                </Link>
                                <Link to="/submissions" className={`nav-link ${isActive('/submissions') ? 'active' : ''}`}>
                                    Submissions
                                </Link>
                            </>
                        )}
                    </div>

                    {/* Auth Section */}
                    <div className="nav-auth">
                        {!isAuthenticated ? (
                            <div className="auth-buttons">
                                <Link to="/login" className="btn btn-outline">Login</Link>
                                <Link to="/register" className="btn btn-primary">Register</Link>
                            </div>
                        ) : (
                            <div className="user-menu">
                                <div className="user-info" onClick={() => setIsDropdownOpen(!isDropdownOpen)}>
                                    <div className="user-avatar">
                                        {user?.name?.charAt(0).toUpperCase() || 'U'}
                                    </div>
                                    <span className="user-name">{user?.name || 'User'}</span>
                                </div>
                                {isDropdownOpen && (
                                    <div className="dropdown-menu">
                                        <Link to="/profile" className="dropdown-item">Profile</Link>
                                        <Link to="/settings" className="dropdown-item">Settings</Link>
                                        <button onClick={handleLogout} className="dropdown-item">
                                            Logout
                                        </button>
                                    </div>
                                )}
                            </div>
                        )}

                        <button className="mobile-menu-toggle" onClick={() => setIsMobileMenuOpen(!isMobileMenuOpen)}>
                            <span className={`hamburger ${isMobileMenuOpen ? 'active' : ''}`}></span>
                        </button>
                    </div>
                </div>

                {/* Mobile Menu */}
                {isMobileMenuOpen && (
                    <div className="mobile-menu">
                        <Link to="/" className={`mobile-nav-link ${isActive('/') ? 'active' : ''}`}>
                            Home
                        </Link>
                        {isAuthenticated && (
                            <>
                                <Link to="/dashboard" className={`mobile-nav-link ${isActive('/dashboard') ? 'active' : ''}`}>
                                    Dashboard
                                </Link>
                                <Link to="/events" className={`mobile-nav-link ${isActive('/events') ? 'active' : ''}`}>
                                    Events
                                </Link>
                                <Link to="/journals" className={`mobile-nav-link ${isActive('/journals') ? 'active' : ''}`}>
                                    Journals
                                </Link>
                                <Link to="/communities" className={`mobile-nav-link ${isActive('/communities') ? 'active' : ''}`}>
                                    Communities
                                </Link>
                                <Link to="/submissions" className={`mobile-nav-link ${isActive('/submissions') ? 'active' : ''}`}>
                                    Submissions
                                </Link>
                                <button onClick={handleLogout} className="mobile-nav-link logout-button">
                                    Logout
                                </button>
                            </>
                        )}
                        {!isAuthenticated && (
                            <div className="mobile-auth-buttons">
                                <Link to="/login" className="btn btn-outline">Login</Link>
                                <Link to="/register" className="btn btn-primary">Register</Link>
                            </div>
                        )}
                    </div>
                )}
            </div>
        </nav>
    );
}

export default Navbar;
